import React from "react";
import { useNavigate,useLocation } from 'react-router-dom';
import {useState} from 'react'

const UpdateForm=(data)=>{
    let navigate = useNavigate();
    const[name,setName]=useState('');
    const[date,setDate]=useState('');
    const[email,setEmail]=useState('');
    const[called,setCalled]=useState('');
   
    return(
        <div>
            
        <br/>
        <div class="ui container">
        {  data.map((student)=>{return <form class="ui form" >
            <div class="fields">
            <div class="eight wide field">
                <label>First Name</label>
                <input required defaultValue={student.name}  type="text" value={name} onChange={(e)=>setName(e.target.value)} name="first-name" placeholder="First Name"/>
            </div>
            <div class="field">
              <label>Date Joined</label>
              <input required  type="text" value={date} onChange={(e)=>setDate(e.target.value)} name="last-name" placeholder="Last Name"/>
            </div>
            <div class="field">
              <label>E-mail</label>
              <input requried  type="email" value={email} onChange={(e)=>setEmail(e.target.value)}  name="last-name" placeholder="Email"/>
            </div>              
            <div class="field">
              <label>Called</label>
              <input required defaultValue={data.called} type="text" value={called} onChange={(e)=>setCalled(e.target.value)} name="last-name" placeholder="Called"/>
            </div>              
            </div>
            <button class="ui button" type="submit">Submit</button> 
        </form>
        })}
        </div>
    </div>
    )
}
export default UpdateForm
